import React, { useState } from 'react';

import './project-images.css';

export default function ProjectImages({ data, animate }) {

    return (
        <React.Fragment>
            <div className='images-container mobile no-noise'>
                {data.interface.mobile.map((img, i) => (
                        <video className='video-player' autoPlay loop muted key={i}>
                            <source src={img} type='video/mp4' />
                        </video>
                    ))}
                <div className='screen'/>
            </div>
            </React.Fragment>
    )
}
